For only my second national 2 day match ever with the new @visionprc Pro chassis, I’d say that it was a pretty good weekend. With minimal practice on the new chassis I was able to finish third place at the 2024 VPRC rifleman’s revival this past weekend in Rocky Mount Virginia. It was an amazingly well run as always. The match directors Bryan Lewis and Andy Slade never disappoint putting so much passion in to there matches going as far as adjusting some targets sizes for day two. To better reflect the level of challenge they were looking for. 
This new vision just keeps on inspiring me it’s so rigid and comfortable. It is truly a force multiplier. 
 Congrats to @franciscolonprs on taking home the win and @jeffguerry on second place also run the new Vision Pro by the way. 
Huge thanks to those that support me. 
 @visionprc with the new Vision Pro 
@area419official for the chamber job muzzle brake arca plate scope mount etc. 
@gcprifleco for be the amazing importer of the best chassis in the world. If you want to get your hands on one of these bad boy hit them up. 
